import React from 'react';
import styled from '@emotion/styled';

const List = styled.ul `
`;

const Item = styled.a `
    padding: 0px, 10px, 0px, 10px;

`;

function Navbar() {
    return (
        <React.Fragment>
            <List>
                <Item>About</Item>
                <Item>Info</Item>
                <Item>Projects</Item>
            </List>
        </React.Fragment>
    );
}
export default Navbar;
